import React from "react";
import "./OurServices.css"; // You'll need to create this CSS file

const ServiceCard = ({ icon, title, description, highlighted }) => {
  // Base URL where your icons are hosted
  const baseURL = "https://example.com/icons/"; // Replace with your actual base URL

  return (
    <div className={`service-card ${highlighted ? "highlighted" : ""}`}>
      <img
        src={`${baseURL}${icon}.svg`} // Construct the full URL for the icon
        alt={title}
        className="service-icon"
      />
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  );
};

const OurServices = () => {
  return (
    <div className="our-services-container">
      <h1 className="title">
        We Provide <span className="highlight">Best Services</span> For You
      </h1>
      <p className="description">
        Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod
        tempor incididunt ut labore et dolore magna aliqua
      </p>
      <div className="services-grid">
        <ServiceCard
          icon="shield"
          title="Safety Guarantee"
          description="Lorem ipsum dolor sit amet, consectet adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore"
        />
        <ServiceCard
          icon="tag"
          title="Discount & Promo"
          description="Lorem ipsum dolor sit amet, consectet adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore"
        />
        <ServiceCard
          icon="certificate"
          title="Professional Staff"
          description="Lorem ipsum dolor sit amet, consectet adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore"
        />
        <ServiceCard
          icon="clock"
          title="Schedule On Time"
          description="Lorem ipsum dolor sit amet, consectet adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore"
        />
        <ServiceCard
          icon="mobile"
          title="Online Booking"
          description="Lorem ipsum dolor sit amet, consectet adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore"
        />
        <ServiceCard
          icon="support"
          title="24/7 Support"
          description="Lorem ipsum dolor sit amet, consectet adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore"
        />
      </div>
    </div>
  );
};

export default OurServices;
